import { useLocation } from "react-router-dom";

const Tutoriales = () => {
  const location = useLocation();
  const { tutoriales } = location.state || { tutoriales: [] };

  return (
    <div>
      <h2>Tutoriales</h2>
      {tutoriales.length === 0 ? (
        <p>No hay tutoriales disponibles.</p>
      ) : (
        <ul>
          {tutoriales.map((tutorial, index) => (
            <li key={index}>
              <h4>{tutorial.nombre || "Nombre no disponible"}</h4>
              <p>{tutorial.descripcion || "Descripción no disponible"}</p>
              {/* Si el tutorial tiene más detalles, puedes agregarlos aquí */}
              <p><strong>Fecha:</strong> {tutorial.fecha || "Fecha no disponible"}</p>
              <p><strong>Autor:</strong> {tutorial.autor || "Autor no disponible"}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Tutoriales;
